#include <bits/stdc++.h>
using namespace std;
#define ll long long
const int N = 1e5 + 5;
ll a[N];
ll t[4 * N], lazy[4 * N],q[N], d[N];
int l[N], r[N];

void push(int n, int b, int e) {
  if (lazy[n] == -1) return;
  t[n] = t[n] + lazy[n];
  if (b != e) {
    int l = 2 * n;
    int r = (2 * n) + 1;
    if (lazy[l] == -1) lazy[l] = lazy[n];
    else lazy[l] += lazy[n];
    if (lazy[r] == -1) lazy[r] = lazy[n];
    else lazy[r] += lazy[n];
  }
  lazy[n] = -1;
}

ll merge(ll l, ll r) {
  return l + r;
}

void build(int n, int b, int e) {
  lazy[n] = -1;
  if (b == e) {
    t[n] = a[b]; 
    return;
  }
  int l = 2 * n;
  int r = (2 * n) + 1;
  int mid = (b + e) / 2;
  build(l, b, mid);
  build(r, mid + 1, e);
  t[n] = merge(t[l], t[r]);
}

ll query(int n, int b, int e, int i) {
  push(n, b, e);
  if (b > i or e < i) return 0;
  if (b == e) return t[n];
  int l = 2 * n;
  int r = (2 * n) + 1;
  int mid = (b + e) / 2;
  if (i <= mid) return query(l, b, mid, i);
  else return query(r, mid + 1, e, i);
}

void upd(int n, int b, int e, int i, int j, int v) {
  push(n, b, e);
  if (b > j or e < i) return;
  if (b >= i and e <= j) {
    lazy[n] = v;
    push(n, b, e);
    return;
  }
  int l = 2 * n;
  int r = (2 * n) + 1;
  int mid = (b + e) / 2;
  upd(l, b, mid, i, j, v);
  upd(r, mid + 1, e, i, j, v);
  t[n] = merge(t[l], t[r]);
}

int32_t main() {
  ios_base::sync_with_stdio(0); cin.tie(0);

  int n, m, k; cin >> n >> m >> k;
  for (int i = 1; i <= n; i++) {
    cin >> a[i];
  }
  build(1, 1, n);
  for (int i = 1; i <= m; i++) {
   cin >> l[i] >> r[i] >> d[i];
  }
  for (int i = 1; i <= k; i++) {
    int x, y; cin >> x >> y;
    q[x]++;
    q[y + 1]--;
  }
  for (int i = 1; i <= m; i++) {
    q[i] += q[i - 1];
  }
  for (int i = 1; i <= m; i++) {
    d[i] = q[i] * d[i];
    upd(1, 1, n, l[i], r[i], d[i]);
  }
  for (int i = 1; i <= n; i++) {
    cout << query(1, 1, n, i) << ' ';
  }
  cout << '\n';
}

