#include <bits/stdc++.h>
using namespace std;
#define ll long long
const int N = 1e5 + 5;
struct tup {
  int left, right, value;
};
map<int, tup> Q;
ll a[N];
ll t[4 * N], lazy[4 * N];
int q[N];

void push(int n, int b, int e) {
  if (lazy[n] == 0) return;
  t[n] = t[n] + lazy[n] * (e - b + 1);
  if (b != e) {
    int l = 2 * n;
    int r = (2 * n) + 1;
    lazy[l] += lazy[n];
    lazy[r] += lazy[n];
  }
  lazy[n] = 0;
}

ll merge(ll l, ll r) {
  return min(l, r);
}

void build(int n, int b, int e) {
  if (b == e) {
    t[n] = a[b]; return;
  }
  int l = 2 * n;
  int r = (2 * n) + 1;
  int mid = (b + e) / 2;
  build(l, b, mid);
  build(r, mid + 1, e);
  t[n] = merge(t[l], t[r]);
}

ll query(int n, int b, int e, int i) {
  if (b > i or i > e) return LLONG_MAX;
  push(n, b, e);
  if (b == e) return t[n];
  int l = 2 * n;
  int r = (2 * n) + 1;
  int mid = (b + e) / 2;
  if (i <= mid) return query(l, b, mid, i);
  else return query(r, mid + 1, e, i);
}

void upd(int n, int b, int e, int i, int j, int v) {
  push(n, b, e);
  if (b > j or e < i) return;
  if (b >= i and e <= j) {
    lazy[n] = v;
    push(n, b, e);
    return;
  }
  int l = 2 * n;
  int r = (2 * n) + 1;
  int mid = (b + e) / 2;
  upd(l, b, mid, i, j, v);
  upd(r, mid + 1, e, i, j, v);
  t[n] = merge(t[l], t[r]);
}

int32_t main() {
  ios_base::sync_with_stdio(0); cin.tie(0);

  int n, m, k; cin >> n >> m >> k;
  for (int i = 1; i <= n; i++) {
    cin >> a[i];
  }
  build(1, 1, n);
  for (int i = 1; i <= m; i++) {
    int l, r, d; cin >> l >> r >> d;
    l++, r++;
    Q[i] = {l, r, d};
  }
  for (int i = 1; i <= k; i++) {
    int l, r; cin >> l >> r;
    q[l]++;
    q[r + 1]--;
  }
  for (int i = 1; i <= m; i++) {
    q[i] += q[i - 1];
  }
  for (int i = 1; i <= m; i++) {
    int l = Q[i].left;
    int r = Q[i].right;
    int d = Q[i].value;
    d = q[i] * d;
    upd(1, 1, n, l, r, d);
  }
  for (int i = 1; i <= n; i++) {
    cout << query(1, 1, n, i) << ' ';
  }
  cout << '\n';
}

