    cout << "–í–≤–µ–¥–∏—Ç–µ –º–µ—Å—è—Ü: ";
    int month;
    cin >> month;
    size_t n = 0;
    for (const auto& record : table) {
        if (record.in_month(month)) {
            cout << setw(2) << ++n << ". " << record << '\n';
        }
    }
    if (!n) puts("–°–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤–∏—è –Ω–µ –æ–±–Ω–∞—Ä—É–∂–µ–Ω—ã!");
}
